import React,{Component} from 'react';
import Slider from 'react-slick';
import img1 from "./../img/img2.png";
import img2 from "./../img/img3.png";
import "slider.css";
const Slider1 = () => {

  var settings = {
    dots: true,
    infinite: true,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 1300,
    
  };
  return(
      <div className="slideshow">
           <div>
      
        <Slider {...settings}>
          <div>
            <h3><img src={img1}></img></h3>
          </div>
          <div>
          <h3>  <img src={img2}></img></h3>
          </div>
         
        </Slider>
      </div>
      </div>
  );
};

export default Slider1;
